import React from 'react'
import Pizza from '../components/Pizza'
import pizzas from '../pizzasdata'
function Homescreen() {
    return (
        <div>
            <div className="row">
                {pizzas.map((pizza)=>{
                    
                    <h1 >{pizza.name}</h1>
                })}
            </div>
        </div>
    )
}

export default Homescreen
